const data2024 = data202[0];

function findMargin(){
    let marginObj = {};
    for(let state in data2024){
        for(let const_name in data2024[state]){
            if(!data2024[state][const_name]["candidates"][1]){
                continue;
            }
            let margin = data2024[state][const_name]["candidates"][0]["vts"]-data2024[state][const_name]["candidates"][1]["vts"];
            if(!marginObj[margin]){
                marginObj[margin] = [];
            }
            marginObj[margin].push(data2024[state][const_name]["candidates"][0]["cId"]);
        }
    }
    return marginObj;
}

let marginObj = findMargin();
let margin = [];
